export class HomePage extends Component {

    render = () => {

        return (
            <diV>
            <Container>
              <div style="">
                  <EducationRequest/>
              </div>
                
           <div>
                <MarketRequest/>
           </div>
               
          
           
            </Container>
            </diV>
        
           
        )
    }
}
